import { faTruckLoading } from '@fortawesome/free-solid-svg-icons';
import '../Admission/admission.css';

export const Admissions=(props)=>{
    return (
    <div id='admission'>

                    {/* Admission header image */}
           <div>
             <div className="main" style={{backgroundImage:"{props.data ? props.data.adminMainImage : 'Loading.....''}"}}>
                {/* Blured Div */}
                <div className="filterBlur mainTxt">Admissions</div>
             </div>
            </div>

            {/* Nursery,Primary             */}
           <div className='NurseryDiv'>

              {/* Recent Programs */}
              <aside className='recents'>
                    <div className='recentCard'></div>
                    <div className='recentCard'></div>
                    <div className='recentCard'></div>
              </aside>

              {/* Nursary */}
              <section>
                  {/* Nursery */}
                  <div>
                      {/* Image */}
                      <div><img src="" alt="" /></div>
                      <div>
                          {/* Title */}
                          <div></div>
                          <div></div>
                      </div>
                  </div>
                  {/* Primary */}
                  <div>
                 
                      <div>
                            {/* Title */}
                          <div></div>
                          <div></div>
                      </div>
                      {/* Image */}
                      <div></div>
                  </div>
             </section> 
           </div>

           {/* Secondary */}
           <div className='row'></div>

           {/* Admission Form */}
           <div className='row'></div>
    </div>
    )
}
